      content: >
        [bold][italic]Варианты ругательных экзипуций касательно Интернатуры первого и второго года поступления.[/italic][/bold] 


        Забудьте о цвете ваших дипломов и о том, что там написано слово "врач". Это ложь. Вы ни хрена не знаете.


        А свою мочу вы можете и дома пить. Добавьте туда лимон и мяту - будет называться "Урино-мохито". Судя по названию, очень должно бодрить.


        Вы - инородные тела в здоровом организме медицины!


        (Вставте имя и произносите грозным тоном) держи тысячу - купи на нее мозги или книгу по медицине. Лучше книгу: мозги, боюсь, твой организм отторгнет.


        Страшный человек! Нельзя к нему спиной поворачиваться: он может клизмой сонную артерию проткнуть.


        Ну, что, нирвана запойная! Ты, что, совсем остатки инстинкта самосохранения пробухал, а?! Ты хоть соображаешь, кого ты напоил, и что тебе за это будет?!


        Послушай меня, жертва хаотической репликации хромосом. Инстинкт самосохранения — это базовый инстинкт, присущий любому существу. Как же ты его отключить-то умудрился, когда мне эту фразу говорил? Я же из тебя пинцетом нити ДНК повыдёргиваю и ты у меня по швам расползёшься. Я у тебя пункцию из такого места возьму, о котором ты даже не догадываешься, как впрочем и о смысле слова «пункция». Я тебя в такой пазл нарежу — ни один травматолог не соберёт. Ты всё понял, питекантроп, социально неадаптированный? Тогда ползи в свою пещеру, пока твой искалеченный алкоголем мозг не вскипел от переизбытка информации!


        (Вставте имя) среди вещей, которые меня действительно интересуют в жизни, вопрос развития твоей личности находится где-то между проблемами миграции ушастой совы, и особенностями налогообложения в Конго.


        Живой? Это поправимо!


        Быстро эволюционируем до прямоходящих, и за мной!
